import { Button, Form, Input, Select } from "antd";

const { Option } = Select;

interface IInitialValues {
	title: string
	isActive: boolean
}

interface IFProps {
	initialValues?: IInitialValues
	onFinish?: (values: IInitialValues) => void
	isLoading?: boolean
}


const UpdateRoleForm: React.FC<IFProps> = ({ initialValues, onFinish, isLoading }) => {

	return (
		<Form
			size="middle"
			layout="vertical"
			initialValues={initialValues}
			onFinish={onFinish}>
			<Form.Item
				label="Tile"
				name="title">
				<Input defaultValue={initialValues?.title} />
			</Form.Item>
			<Form.Item
				label="Is Active"
				name="isActive">
				<Select
					placeholder="select a value"
					defaultValue={initialValues?.isActive ? "True" : "False"}>
					<Option value="True">True</Option>
					<Option value="False">False</Option>
				</Select>
			</Form.Item>


			<Form.Item>
				<Button loading={isLoading} type="primary" htmlType="submit">
					Submit
				</Button>
			</Form.Item>
		</Form>
	);
};

export default UpdateRoleForm;
